import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import Navbar from './Components/Navbar/Navbar';
import Home from './Pages/Home/Home';
import MyApplication from './Pages/My-Application/MyApps';
import Shifts from './Pages/Shifts/Shifts';
import InternetStatus from './Pages/InternetStatus/InternetStatus';
import Chat from './Pages/Chats/Chats';
import Login from './Pages/Login/Login';
import Signup from './Pages/Signup/Signup';
import TechnicianProfile from './Components/TechnicianProfile/TechnicianProfile';
import TechnicianTickets from './Protected_Apps/Tickets/TechnicianTickets';

function App() {
  const [authState, setAuthState] = useState({
    isAuthenticated: false,
    username: '',
    email: '',
    userType: null, // 'technician' or 'client'
    loading: true
  });

  // Check for existing session on app load
  useEffect(() => {
    const token = localStorage.getItem('token');
    const userData = localStorage.getItem('userData');

    if (token && userData) {
      try {
        const decoded = jwtDecode(token);
        const user = JSON.parse(userData);

        setAuthState({
          isAuthenticated: true,
          username: user.username,
          email: user.email,
          userType: user.userType,
          loading: false
        });
      } catch (error) {
        console.error('Session validation failed:', error);
        handleLogout();
      }
    } else {
      setAuthState(prev => ({ ...prev, loading: false }));
    }
  }, []);

  const handleLogin = (userData, token) => {
    localStorage.setItem('token', token);
    localStorage.setItem('userData', JSON.stringify(userData));

    setAuthState({
      isAuthenticated: true,
      username: userData.username,
      email: userData.email,
      userType: userData.userType,
      loading: false
    });
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('userData');
    setAuthState({
      isAuthenticated: false,
      username: '',
      email: '',
      userType: null,
      loading: false
    });
  };

  // Protected Route Component
  const ProtectedRoute = ({ children, requiredUserType }) => {
    if (authState.loading) return <div className="loading-spinner">Loading...</div>;

    if (!authState.isAuthenticated) {
      return <Navigate to="/login" replace />;
    }

    if (requiredUserType && authState.userType !== requiredUserType) {
      return <Navigate to="/unauthorized" replace />;
    }

    return children;
  };

  if (authState.loading) {
    return <div className="app-loading">Loading application...</div>;
  }

  return (
    <Router>
      <Navbar 
        isAuthenticated={authState.isAuthenticated}
        username={authState.username}
        userType={authState.userType}
        onLogout={handleLogout}
      />

      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login onLogin={handleLogin} />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/unauthorized" element={<div>You don't have permission to access this page</div>} />

        {/* Authenticated Routes */}
        <Route path="/my-application" element={
          <ProtectedRoute>
            <MyApplication userType={authState.userType} />
          </ProtectedRoute>
        }>
          <Route path="tickets" element={
            <ProtectedRoute requiredUserType="technician">
              <TechnicianTickets username={authState.username} />
            </ProtectedRoute>
          } />
        </Route>

        {/* Technician-Specific Routes */}
        <Route path="/technicianprofile" element={
          <ProtectedRoute requiredUserType="technician">
            <TechnicianProfile 
              username={authState.username}
              userType={authState.userType}
            />
          </ProtectedRoute>
        } />

        {/* Shared Authenticated Routes */}
        <Route path="/shifts" element={
          <ProtectedRoute>
            <Shifts userType={authState.userType} />
          </ProtectedRoute>
        } />

        <Route path="/internet-status" element={
          <ProtectedRoute>
            <InternetStatus />
          </ProtectedRoute>
        } />

        <Route path="/chat" element={
          <ProtectedRoute>
            <Chat />
          </ProtectedRoute>
        } />
      </Routes>
    </Router>
  );
}

export default App;
